<!-- JS Code -->
<script type="text/javascript" src="js/jquery.js"></script>
<script type="text/javascript" src="js/jquery.mixitup.js"></script>
<script type="text/javascript" src="js/main.js"></script>
<script src="js/initialization.js"></script>

</head>


</head>

<body>

<section id="devs">
    <nav class="wrapper ns wf">
        <div class="set ib">
            <h1>Team</h1>
            <ul>
                <li class="button filter active" data-role="button" data-filter="all">View All</li>
                <li class="button filter" data-role="button" data-filter="Architecture">Architecture</li>
                <li class="button filter" data-role="button" data-filter="Frog3">Frog3</li>
                <li class="button filter" data-role="button" data-filter="What the Frog">What the Frog</li>
                <li class="button filter" data-role="button" data-filter="Frogfathers">Frogfathers</li>
                <li class="button filter" data-role="button" data-filter="Reservoir Frogs">Reservoir Frogs</li>
                <li class="button filter" data-role="button" data-filter="Cerberus">Cerberus</li>
            </ul>
        </div>
        <div class="set ib">
            <h1>skills</h1>
            <ul>
                <li class="button filter active" data-role="button" data-filter="js">js</li>
                <li class="button filter" data-role="button" data-filter="php">php</li>
                <li class="button filter" data-role="button" data-filter="css">css</li>
                <li class="button filter" data-role="button" data-filter="html">html</li>
                <li class="button filter" data-role="button" data-filter="ios">ios</li>
                <li class="button filter" data-role="button" data-filter="build">build</li>
                <li class="button filter" data-role="button" data-filter="git">git</li>
                <li class="button filter" data-role="button" data-filter="db">db</li>
            </ul>
        </div>
        <div class="set ib">
            <h1>Sort</h1>
            <ul>
                <li class="button sort arrow" data-sort="data-user" data-order="desc"><span>user <div class="arr_desc ib"></div></span></li>
                <li class="button sort arrow" data-sort="data-user" data-order="asc"><span>user <div class="arr_asc ib"></div></span></li>
                <li class="button sort" data-sort="random">Randomize</li>
                <li>
                    <div class="button ib layout active" id="GoGrid">Grid</div>
                    <div class="button ib layout" id="GoList">list</div>
                </li>
                <li class="break"></li>
            </ul>
        </div>
    </nav>


    <div class="wrapper">
        <ul class="people">

            <li class="gap ib"></li>
            <li class="gap ib"></li>
            <li class="gap ib"></li>
            <li class="break ib"></li>
        </ul>
    </div>
</section>

</body>
</html>
